import React from "react";

export default function Eventos() {
    return (
        <div className="flex justify-center items-center h-screen text-2xl font-bold">
            ZONA EVENTOS
        </div>
    );
    const eventos = [
        { id: 1, titulo: "Concierto", fecha: "2025-04-15", lugar: "Madrid" },
        { id: 2, titulo: "Taller React", fecha: "2025-04-18", lugar: "Online" },
      ];

      function Eventos() {
        return (
          <div className="container mt-5">
            <h2>Eventos</h2>
            <ul className="list-group">
              {eventos.map((evento) => (
                <li key={evento.id} className="list-group-item">
                  <strong>{evento.titulo}</strong> - {evento.fecha} en {evento.lugar}
                </li>
              ))}
            </ul>
          </div>
        );
      }
}
